		<script type="text/javascript">
			checkReady();
			function checkReady() {
				var svg = document.getElementById("map");
				if (svg == null) {
					setTimeout("checkReady()", 300);
				} else {
					//修改模拟量值
					var PIT_503 = svg.getElementById('PIT_503');
					var FT_1201 = svg.getElementById('FT_1201');
					var FT_201 = svg.getElementById('FT_201');
					var PIT_513 = svg.getElementById('PIT_513');
					var PIT_514 = svg.getElementById('PIT_514');
					var PIT_515 = svg.getElementById('PIT_515');
					var PIT_516 = svg.getElementById('PIT_516');
					var PIT_039 = svg.getElementById('PIT_039');
					var PIT_101 = svg.getElementById('PIT_101');
					var PIT_040 = svg.getElementById('PIT_040');

					var plcList = [{
						'PIT_503': '空压机出口压力'
					}, {
						'FT_1201': '累计流量'
					}, {
						'FT_201': '瞬时流量'
					}, {
						'PIT_513': '燃气探头4'
					}, {
						'PIT_514': '燃气探头3'
					}, {
						'PIT_515': '燃气探头2'
					}, {
						'PIT_516': '燃气探头1'
					}, {
						'PIT_039': '氢气瓶组压力'
					}, {
						'PIT_101': '入口压力'
					}, {
						'PIT_040': '加氢机出口压力'
					}];

					var plcList2 = [{
						SOV_301: '先导阀控制输出'
					}, {
						SOV_303: '加氢阀控制输出'
					}, {
						SOV_305: '导向阀控制输出'
					}];
					//回头修改为localhost
					$.get("http://101.36.151.185:9901/?station_id=6", function(data) {
						//alert(data.length);
						//var result =jQuery.parseJSON(data);
						$.each(data, function(n, value) {
							for (var i = 0, l = plcList.length; i < l; i++) {
								for (var key in plcList[i]) {
									if (plcList[i][key] == value.signalName) {
										var temp_variable = eval(key);
										if (plcList[i][key] == '累计流量') {
											temp_variable.textContent = value.value + "kg";
										} else if (plcList[i][key] == '瞬时流量') {
											temp_variable.textContent = value.value + "kg/min";
										} else if (plcList[i][key] == '燃气探头1' || plcList[i][key] == '燃气探头2' || plcList[i][key] == '燃气探头3' ||
											plcList[i][key] == '燃气探头4') {
											temp_variable.textContent = value.value + "%LEL";
										} else {
											if (typeof(temp_variable) != undefined) {
												temp_variable.textContent = value.value + "MPa";
											} else {
												console.log(key)
											}
										}
									}
								}
							};
							for (var i = 0, l = plcList2.length; i < l; i++) {
								for (var key in plcList2[i]) {
									if (plcList2[i][key] == value.signalName) {
										var temp_red = svg.getElementsByClassName(key + '_red');
										var temp_green = svg.getElementsByClassName(key + '_green');
										let length1 = temp_red.length >= temp_red.length ? temp_red.length : temp_red.length;
										if (value.value == "ON") {
											for (var j = 0; j < length1; j++) {
												//console.log(key+'_red'+j.toString());
												if (temp_red.length > j) {
													temp_red[j].setAttribute('display', 'none');
												}

												if (temp_green.length > j) {
													temp_green[j].setAttribute('display', 'block');
												}
											}
										} else if (value.value == "OFF") {
											for (var k = 0; k < length1; k++) {
												if (temp_red.length > k) {
													temp_red[k].setAttribute('display', 'block');
												}
												if (temp_green.length > k) {
													temp_green[k].setAttribute('display', 'none');
												}
											}
										}
									}
								}
							}
						});
					});
					setTimeout("checkReady()", 10000);
				}
			}
